import './App.css';
import MicrosoftForm from './Components/MicrosoftForm';
import Info from './Components/MicrosoftForm';
import GoogleForm from './Components/GoogleForm'
import React from 'react';
import { TableauChart } from './Components/TableauChart';


function App() {
    return <Content />;
}

function AddItem() {
  return (
    <form>
      <label for="text-form">Type Something: </label>
      <input type="text" id="text-form" />
    </form>
  );
}

function IfElse(){
  var showValue = false; 
  // var munyanyo = "doisef"; 

  if (showValue) {
    return (
      <form>
        <label for="text-form2">Type your mother's first name: </label>
        <input type="text" id="text-form2" />
      </form>
    );
  }
  else {
    return (
      <form>
        <label for="text-form3">Type your father's last name: </label>
        <input type="text" id="text-form3" />
      </form>
    );
  }
}

export default App;
